import React from 'react';
import img from '../../imagenes/DarthVader.jpg';
import './logo.css';

const Logo = () => {
  return <div className ="BoxContenedor">
      <div className ="BoxImg"><img src={img} alt = "ImgDarthVader" className = "ImagenDarthVader"></img></div>
      <h3>May The Force</h3>
      <h3>Be with you</h3>
  </div>;
};

export default Logo;
